import logo from './logo.svg';
import './App.css';

function App() {
  return (
    <div className="App">
      <header>
        <div id="logo">
          <a href="#"><h1>Jisu Portfolio</h1></a>
        </div>
        <nav>
          <ul>
            <li><a href="#Home">Home</a></li>
            <li><a href="#Project">Project</a></li>
            <li><a href="#Recommend">Recommend</a></li>
            <li><a href="#Contact">Contact</a></li>
          </ul>
        </nav>
      </header>
    </div>
  );
}

export default App;
